INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (125801, 1, 321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 0, 24001, 2, "リリ", 1, 1, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (126001, 1, 322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 0, 24001, 2, "クリア", 2, 1, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (126101, 1, 323, "んーと。\nこれ、あげる。\nはい", 0, 24001, 2, "プレシア", 3, 1, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (125801, 1, 324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 0, 24001, 2, "リリ", 4, 2, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (126001, 1, 325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 0, 24001, 2, "クリア", 5, 2, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (126101, 1, 326, "お兄。\nきてくれて、うれしい", 0, 24001, 2, "プレシア", 6, 2, 40011);
